  false,\n\t\"url\": null,\n\t\"notes\": \"Collected from a variety of sources both
  commercial and internal, this layer represents shopping center locations within
  Volusia County and is maintained by the Department of Economic Development. An additional
  filter was employed to try and collect only those with significant surface parking
  area for potential use during emergency operations. Location points are determined
  based on previously existing address information, by utilizing the parcel layer
  centroid for parcels exhibiting Department of Revenue Codes 15 & 16, or by visual
  inspection using February 2006 aerial photography to determine the best placement
  of the actual point.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
